import React from "react";

const TrailSection = () => {
  const backgroundStyle = {
    backgroundImage: `url('images/Rectangle3.png')`,
    backgroundSize: "cover",
    backgroundRepeat: "no-repeat",
  };
  return (
    <div className="flex justify-center mt-8 md:mt-28" id="trails">
      <div
        className="h-[364px] md:h-[400px] lg:h-[450px] xl:h-[500px] 2xl:h-[600px] max-w-screen-xl mx-auto flex justify-center items-center flex-col text-center"
        style={backgroundStyle}
      >
        <h1 className="text-white text-2xl md:text-3xl lg:text-4xl xl:text-5xl 2xl:text-6xl">
          JOIN OUR COMMUNITY
        </h1>

        <h1 className="text-white text-2xl md:text-3xl lg:text-4xl xl:text-5xl 2xl:text-6xl mt-4">
          We are trusted by over{" "}
          <span className="text-[#63D8A1] text-3xl md:text-4xl lg:text-5xl xl:text-6xl 2xl:text-7xl">
            5000+
          </span>{" "}
          clients.
          <br />
          Join them now and grow your reach with us.
        </h1>
        <button className="bg-[#6ED8A1] text-[#392B85] text-base md:text-lg lg:text-xl xl:text-2xl 2xl:text-3xl py-2 md:py-4 px-6 md:px-10 mt-4 md:mt-8 rounded-md">
          Contact Us
        </button>
      </div>
    </div>
  );
};

export default TrailSection;
